import React from "react";
import styles from "./userList.module.css";

function UserList({ users }) {
  return (
    <ul className={styles['display-users']}>
      {users &&
        users.map((user) => (
          <li>
            {user["user-name"]}  (Age {user['user-age']})
          </li>
        ))}

    </ul>
  );
}

export default UserList;
